import React, { Component } from 'react';
import Cardlist from './Cardlist';
import SearchBox from './SearchBox';
import { robots } from './robots';

class App extends Component {
    constructor () {
      super ();
      this.state = {
        robots : robots,
        searchinput : ""
      }
    }

    onSearchChange(event){
        console.log (event);
    }

    render () {
        return (
            <div className="tc">
              <h1>RoboFriends</h1>
              <SearchBox search/>
              <Cardlist robots = { this.state.robots }/>  
            </div>
          );
    }
}

export default App;
